import { createStore, applyMiddleware } from 'redux';
import authReducer from './authSlice';
import loggerMiddleware from './loggerMiddleware';

const rootReducer = {
    auth: authReducer,
};

export const store = createStore(
    rootReducer,
    applyMiddleware(loggerMiddleware)
);
